import React from 'react';
import './Signup.css';
import {Link} from "react-router-dom";
class SignUp extends React.Component  {
  render(){
      return (
          <div>
             
             <div class="container" style={{marginLeft:"200px"}}>
                 
                 <div class="col-xs-12 col-sm-12 col-md-12 col-lg-12">
                     <div className="bgLogin">
                      
                     <div style={{marginLeft:"220px"}}>
                     <div style={{color:"red",float:"left",marginRight:"5px",fontSize:"50px"}}>Đ</div>
                   <div  style={{color:"yellow",float:"left",marginRight:"5px",fontSize:"50px"}}>Ă</div>  
                 <div  style={{color:"greed",float:"left",marginRight:"5px",fontSize:"50px"}}>N</div>  
                 <div  style={{color:"pink",float:"left",marginRight:"5px",fontSize:"50px"}}>G</div>  
                 <div  style={{color:"blue",float:"left",marginRight:"5px",fontSize:"50px"}}>N</div> 
                  < div  style={{color:"yellow",float:"left",marginRight:"5px",fontSize:"50px"}}>K</div> 
               <div  style={{color:"red",float:"left",marginRight:"5px",fontSize:"50px"}}>Ý</div>  
              
               </div>
                        <input type="text" class="form-control name" placeholder="Tên của bạn " required/>
                        <input type="text" class="form-control email" placeholder="Email hoặc số điện thoại" required/>
                        <input type="password" class="form-control pass" placeholder="Nhập mật khẩu" />
                        <input type="password" class="form-control passconfirm " placeholder="Nhập lại mật khẩu" required/>
                        
                        <button type="button" class="btn btn-default btnsignup">ĐĂNG KÝ</button>
                        <h5 style={{marginLeft:"200px",marginTop:"20px",paddingBottom:"10px",color:" aliceblue",fontFamily:"cursive"}} >
                            Bạn đã có tài khoản? &nbsp;
                            <Link to="./login" style={{fontFamily:"'Times New Roman', Times, serif",color:"aliceblue",fontSize:"20px"}}>Đăng nhập ngay !</Link>
                        </h5>
                        
                     </div>
                 </div>
                 
             </div>
             
          </div>
    
  );
}
}
export default SignUp;
